import React, { useEffect, useState } from "react";
import axios from "axios";

const Offers = () => {
  const [offers, setOffers] = useState();

  const getData = async () => {
    const req = await axios.get(
      `https://job-search4.p.rapidapi.com/indeed/search?query=developpeur&page=1`,
      {
        headers: {
          "X-RapidAPI-Host": "job-search4.p.rapidapi.com",
          "X-RapidAPI-Key":
            "385d803c34msh4f0c8826e915ee8p1137f6jsn3639c58a6825",
        },
      }
    );

    const res = await req.data;
    if (res) {
      setOffers(res.jobs);
      console.log(res);
    }
  };

  useEffect(() => {
    getData();
  }, []);

  return (
    <div className="min-h-screen  flex">
      {offers?.map((item) => (
        <div className="p-3 m-2 border-2">
          <h1 className="p-1 text-xl text-white">{item.title}</h1>
          <h3>{item.description}</h3>
          <h3>URL: {item.detail_url}</h3>
        </div>
      ))}
    </div>
  );
};

export default Offers;
